should we also emit a warning in case of `o1`, for clarity about why results aren't streamed? maybe. just seems like model is something you're more likely to let end users configure (eg the way langsmith playground does) in which case warnings would be annoying and unhelpful FYI this warning is raised even when a non-streaming API is used (e.g. ainvoke). This is because `_generate_with_cache` (called by `invoke`) calls `_should_stream` internally: https://github.com/langchain-ai/langchain/blob/ec9b41431ea8bccccc3b9f1679c1e1e16c26e23e/libs/core/langchain_core/language_models/chat_models.py#L831

I don't think it has any bad side effect, besides that the warning used to be raised for a real issue, and it may now be a false positive. However, it is possible that `invoke` used to stream beforehand and won't anymore ü§î

@baskaryan I'd love to know if we can safely bump if we are using `ainvoke` with structured_outputs + pydantic

@efriis FYI removing this cap because dependency resolution appears to go reasonably fast in 3.12 now. Verified that we don't lose any coverage with this as we're not decorating any tests with `@pytest.mark.requires` for outlines.

