- [x] **PR title**: "core: use friendlier names for duplicated nodes in mermaid output"

 - **Description:** When generating the Mermaid visualization of a chain, if the chain had multiple nodes of the same type, the reid function would replace their names with the UUID node_id. This made the generated graph difficult to understand. This change deduplicates the nodes in a chain by appending an index to their names.
- **Issue:** None
- **Discussion:** https://github.com/langchain-ai/langchain/discussions/27714  
- **Dependencies:** None

